import React from "react";
import { Product } from "../../ui/Product";

export const Main: React.FC = () => (
  <div className="main">
    <div className="container">
      <p className="main__text">
        Unfortunately the page is not ready yet.
      </p>

      <p className="main__text">
        Other info coming soon.
      </p>

      <Product />
    </div>
  </div>
);
